goog.provide("goog.events.EventTargetGoogEventsTest");goog.setTestOnly("goog.events.EventTargetGoogEventsTest");goog.require("goog.events");goog.require("goog.events.EventTarget");goog.require("goog.events.eventTargetTester");goog.require("goog.events.eventTargetTester.KeyType");goog.require("goog.events.eventTargetTester.UnlistenReturnType");goog.require("goog.testing");goog.require("goog.testing.jsunit");function setUp(){var newListenableFn=function(){return new goog.events.EventTarget},unlistenByKeyFn=function(src,key){return goog.events.unlistenByKey(key)};goog.events.eventTargetTester.setUp(newListenableFn,goog.events.listen,goog.events.unlisten,unlistenByKeyFn,goog.events.listenOnce,goog.events.dispatchEvent,goog.events.removeAll,goog.events.getListeners,goog.events.getListener,goog.events.hasListener,goog.events.eventTargetTester.KeyType.NUMBER,goog.events.eventTargetTester.UnlistenReturnType.BOOLEAN,!0)}function tearDown(){goog.events.eventTargetTester.tearDown()}function testUnlistenProperCleanup(){goog.events.listen(eventTargets[0],EventType.A,listeners[0]);goog.events.unlisten(eventTargets[0],EventType.A,listeners[0]);goog.events.listen(eventTargets[0],EventType.A,listeners[0]);eventTargets[0].unlisten(EventType.A,listeners[0])}function testUnlistenByKeyProperCleanup(){var keyNum=goog.events.listen(eventTargets[0],EventType.A,listeners[0]);goog.events.unlistenByKey(keyNum)}function testListenOnceProperCleanup(){goog.events.listenOnce(eventTargets[0],EventType.A,listeners[0]);eventTargets[0].dispatchEvent(EventType.A)}function testListenWithObject(){var obj={handleEvent:goog.testing.recordFunction()};goog.events.listen(eventTargets[0],EventType.A,obj);eventTargets[0].dispatchEvent(EventType.A);assertEquals(1,obj.handleEvent.getCallCount())}function testListenWithObjectHandleEventReturningFalse(){var obj={handleEvent:function(){return!1}};goog.events.listen(eventTargets[0],EventType.A,obj);assertFalse(eventTargets[0].dispatchEvent(EventType.A))}